import React from "react";
import { Outlet } from "react-router-dom";
import { Container } from "../../components/container/Container";
import Header from "../../components/header/Header";
import MenuBar from "../../components/menubar/MenuBar";

const Main = () => {
  return (
    <>
      <MenuBar>
        <div></div>
      </MenuBar>
      <Container>
        <Header />
        <Outlet />
      </Container>
    </>
  );
};

export default Main;
